import React,{Component} from "react";
import Card from "react-bootstrap/Card";
// import AddPokemonButton from "../AddPokemonButton/AddPokemonButton";
// import DeletePokemonButton from "../DeletePokemonButton/DeletePokemonButton";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import "./style.css";

import ListGroup from "react-bootstrap/ListGroup"

class PokemonProfile extends Component {
    render() {
        return(
            <div>
                <Container className="pokemon-div">
                    <Row className="justify-content-md-center">
                        <Col md="8">
                            <Card className="justify-content-md-center">
                                <Card.Body>
                                    <Card.Text>
                                        <span className="list">
                                            <ListGroup>
                                                <ListGroup.Item>{this.props.pokemonName}</ListGroup.Item>
                                                <ListGroup.Item>Dapibus ac facilisis in</ListGroup.Item>
                                                <ListGroup.Item>Morbi leo risus</ListGroup.Item>
                                                <ListGroup.Item>Porta ac consectetur ac</ListGroup.Item>
                                                <ListGroup.Item>Vestibulum at eros</ListGroup.Item>
                                            </ListGroup>
                                        </span>
                                        <span className="list">
                                            <li>Pokemon Name: {this.props.pokemonName}</li>
                                            <li>Type: {this.props.type}</li>
                                            <li>Move: {this.props.move}</li>
                                        </span>
                                    </Card.Text>
                                    {/* <Row>
                                        <Col><AddPokemonButton className="addButton"></AddPokemonButton></Col>
                                        <Col><DeletePokemonButton className="deleteButton"></DeletePokemonButton></Col>
                                    </Row> */}
                                </Card.Body>
                            </Card>
                        </Col>
                    </Row>
                </Container>
            </div>
        )
    }
}

export default PokemonProfile;
